import Form from "react-bootstrap/Form";
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function ContactUs () {
    return (
        <div className="bg text text-center pt-5">
            <h1>Contact Us</h1>
            <Form>
                <Row cl></Row>
                <Form.Group className = "mb-3" controlId = "contact_form">
                    <Form.Label>Full Name</Form.Label>
                    <Form.Control type = "input" placeholder = "John Doe"></Form.Control>
                    <Form.Label>Email</Form.Label>
                    <Form.Control type = "email" placeholder = "john.doe@gmail.com"></Form.Control> 
                    <Form.Label>Message</Form.Label>
                    <Form.Control as = "textarea" rows={5} placeholder = "Write message here..."></Form.Control>                    
                </Form.Group>

                <Button variant="light" type="submit">
                    Submit
                </Button>
            </Form>

        </div>
    );
}

export default ContactUs;
